import { Grid, Typography } from '@mui/material';
import WorkIcon from '@mui/icons-material/Work';
import Timeline from '@mui/lab/Timeline';
import TimelineItem, { timelineItemClasses } from '@mui/lab/TimelineItem';
import TimelineSeparator from '@mui/lab/TimelineSeparator';
import TimelineConnector from '@mui/lab/TimelineConnector';
import TimelineContent from '@mui/lab/TimelineContent';
import TimelineDot from '@mui/lab/TimelineDot';

import './Resume.css';
import '../../App.css';
import '../../components/Timeline/Timeline.css';
import {resumeData, about_me} from '../../utils/resumeData';
import BasicTimeline, {CustomTimelineSeperator} from "../../components/Timeline/Timeline";
import { CustomTimelineItem } from '../../components/Profile/Profile';

export default function Resume() {

    return(
        <>
            {/* About Me */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_30'>
                    <span></span>
                    <h6 className='section_title_text'>About Me</h6>
                </Grid>
                <Grid item className='section_text' xs={12}>
                    <Typography variant='body2' className='about_me_text'>{about_me}</Typography>
                </Grid>
            </Grid>

            {/* Education and Experience */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_30'>
                    <span></span>
                    <h6 className='section_title_text'>Resume</h6>
                </Grid>
                {/* <Grid container item xs={12}> */}
                    {/* Experience */}
                    <Grid container item xs={12}>
                        {/* <BasicTimeline title="Experience" icon={<WorkIcon />}>
                            {resumeData.experiences.map(experience => (
                                <CustomTimelineItem className='about_me_text'
                                    title={experience.title}
                                    text={experience.description} />
                            ))}
                        </BasicTimeline> */}
                        <Timeline
                            sx={{
                                [`& .${timelineItemClasses.root}:before`]: {
                                flex: 0,
                                padding: 0,
                                },
                            }}
                            >
                            <TimelineItem>
                                <TimelineSeparator>
                                    <TimelineDot className='timeline_dot'>
                                        <WorkIcon />
                                    </TimelineDot>
                                <TimelineConnector className='connector_height' />
                                </TimelineSeparator>
                                <TimelineContent>Experience</TimelineContent>
                            </TimelineItem>
                            <TimelineItem className='timeline_item'>
                                <TimelineSeparator>
                                    <TimelineDot variant='outlined' />
                                    <TimelineConnector />
                                </TimelineSeparator>
                                <TimelineContent>
                                    <Typography>Full Stack Developer (Apprenticeship) - Next Level Soft Inc.</Typography>
                                    <Typography>October 2022 - Present</Typography>
                                    <Typography>Responsibilities:</Typography>
                                </TimelineContent>
                            </TimelineItem>
                        </Timeline>
                    </Grid>

                    {/* Education */}
                    <Grid container item xs={12}></Grid>
                {/* </Grid> */}
            </Grid>

            {/* Services */}
            <Grid container className='section'>

            </Grid>

            {/* Skills */}
            <Grid container className='section'>

            </Grid>

            {/* Contact */}
            <Grid container className=''>

            </Grid>
        </>
    );

}
